import classes from "./LandlordRegister.module.css"
import { Link } from "react-router-dom";

const LandlordRegister = () => {
    return (
        <section className={classes.landlordRegister}>
            <div className={classes.container}>
                <div className={classes.flex}>
                    <div>
                        <h1>Do you want to lease property?</h1>
                        <p>We'll help you to grow your career and growth.</p>
                    </div>
                    <Link className={classes.button} to="/landlord-register">Become a Landlord</Link>
                </div>
            </div>
        </section>
    )
}

export default LandlordRegister;
